--EXEC dbo.uspAddDailyEvent @StudentId=12345, getdate()
CREATE PROC [dbo].[uspAddDailyEvent]
	@StudentId			INT,
	@Timestamp			DATETIME
AS

SET NOCOUNT ON
BEGIN

	IF NOT EXISTS(SELECT 1 FROM [dbo].[Students] WHERE [StudentNumber] = @StudentNumber)
	BEGIN

		INSERT INTO [dbo].[Students](
		  [StudentNumber]
		  ,[FirstName]
		  ,[LastName]
		  ,[MiddleName]
		  ,[Suffix]
		  ,[Address1]
		  ,[Address2]
		  ,[City]
		  ,[State]
		  ,[ZipCode]
		  ,[SSN]
		  ,[Gender]
		  ,[BirthDate]
		  ,[HomePhone]
		  ,[CellPhone]
		  ,[Email]
		  ,[StatusId]
		  ,[EnrolledDate]
		  ,[GraduationDate]
		  ,[Behavior]	
		  ,[Course]
		)
		VALUES (
		  @StudentNumber,
		  @FirstName,
		  @LastName,
		  @MiddleName,
		  @Suffix,
		  @Address1,
		  @Address2,
		  @City,
		  @State,
		  @ZipCode,
		  @SSN,
		  @Gender,
		  @BirthDate,
		  @HomePhone,
		  @CellPhone,
		  @Email,
		  @StatusId,
		  @EnrolledDate,
		  @GraduationDate,
		  @Behavior, 
		  @Course	
		);		

		SELECT CAST(SCOPE_IDENTITY() AS int)

	END;

END;

