-- EXEC dbo.uspPunchIn @StudentId=12345
-- EXEC dbo.uspPunchIn @StudentId=12345, 'KITCHENAIO'
CREATE PROC [dbo].[uspPunchIn]
	@StudentId		INT,
	@ClockId	VARCHAR(20) = NULL
AS

SET NOCOUNT ON
BEGIN

	UPDATE [dbo].[Students]
    SET	StudentNumber = @StudentNumber,
		FirstName = @FirstName,
		LastName = @LastName,
		MiddleName = @MiddleName,
		Suffix = @Suffix,
		Address1 = @Address1,
		Address2 = @Address2,
		City = @City,
		[State] = @State,
		ZipCode = @ZipCode,
		SSN = @SSN,
		Gender = @Gender,
		BirthDate = @BirthDate,
		HomePhone = @HomePhone,
		CellPhone = @CellPhone,
		Email = @Email,
		StatusId = @StatusId,
		EnrolledDate = @EnrolledDate,
		GraduationDate = @GraduationDate,
		Behavior = @Behavior,
		Course = @Course
	WHERE Id = @Id

	IF @@ROWCOUNT = 0
	BEGIN

		INSERT INTO [dbo].[Students](
		  [StudentNumber]
		  ,[FirstName]
		  ,[LastName]
		  ,[MiddleName]
		  ,[Suffix]
		  ,[Address1]
		  ,[Address2]
		  ,[City]
		  ,[State]
		  ,[ZipCode]
		  ,[SSN]
		  ,[Gender]
		  ,[BirthDate]
		  ,[HomePhone]
		  ,[CellPhone]
		  ,[Email]
		  ,[StatusId]
		  ,[EnrolledDate]
		  ,[GraduationDate]
		  ,[Behavior]	
		  ,[Course]
		)
		VALUES (
		  @StudentNumber,
		  @FirstName,
		  @LastName,
		  @MiddleName,
		  @Suffix,
		  @Address1,
		  @Address2,
		  @City,
		  @State,
		  @ZipCode,
		  @SSN,
		  @Gender,
		  @BirthDate,
		  @HomePhone,
		  @CellPhone,
		  @Email,
		  @StatusId,
		  @EnrolledDate,
		  @GraduationDate,
		  @Behavior,
		  @Course 	
		);

		SET @Id = CAST(SCOPE_IDENTITY() AS int)

	END;

END;

